// AdminDashboard.js

import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import axios from 'axios';
import AdminSidebar from './AdminSidebar'; // Import the new sidebar component
import './AdminDashboard.css'; // Import the CSS file for the dashboard

const AdminDashboard = () => {
  const [payments, setPayments] = useState([]);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const authToken = sessionStorage.getItem('authToken');
    const userRole = sessionStorage.getItem('userRole');

    if (!authToken || userRole !== 'admin') {
      navigate('/auth');
    } else if (location.state === null && location.pathname === '/admin-dashboard') {
      navigate('/auth');
    } else {
      fetchPayments(authToken);
    }
  }, [navigate, location]);

  const fetchPayments = async (token) => {
    try {
      const response = await axios.get('http://localhost:5001/api/admin/payments', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setPayments(response.data.payments);
    } catch (error) {
      console.error('Error fetching payments', error);
    }
  };

  return (
    <div className="dashboard-container">
    <div classname="sidebar">
      <div></div>
      <AdminSidebar /> {/* Use the new sidebar component */}
      </div>
      <div>
      <main className="main-dashboard">
        <header className="dashboard-header">
          <h1>Analytics</h1>
        </header>

        <section className="dashboard-stats">
          <div className="stat-card">
            <h2>Total Users</h2>
            <p>Data about team payments...</p>
          </div>
          <div className="stat-card">
            <h2>Total Payments</h2>
            <p>$5,839</p>
          </div>
          <div className="stat-card">
            <h2>Income Statistics</h2>
            <p>Income stats here...</p>
          </div>
          <div className="stat-card">
            <h2>Best Plan</h2>
            <p>$16.58 Per Month</p>
          </div>
        </section>

        <section className="payment-tracking">
          <h2>Recent Payments</h2>
          <ul>
            {payments.map(payment => (
              <li key={payment._id}>
                {payment.userEmail} - {payment.planName}: ${payment.planPrice} ({payment.status})
              </li>
            ))}
          </ul>
        </section>
      </main>
      </div>
    </div>
  );
};

export default AdminDashboard;
